App.use(cors());
App.use(express.json());



App.get("/", (request, response) => {
    response.send(RenderPage("Home.html", {}));
});

App.get("/doujin", (request, response) => {
    const query = request.query.q;

    if (!query) return;

    const QueryID = 1;
    // const QueryID = Date.now();

    Queries.set(QueryID, query);

    response.redirect(302, `http://localhost:4000/doujin/${QueryID}`);
});

App.get("/doujin/:id", (request, response) => {
    const QueryId = Number(request.path.split("/").at(-1));



    response.send(RenderPage("DoujinId.html", {
        $QUERY$     : Queries.get(QueryId),
        $DOUJIN_ID$ : QueryId
    }));
})


