function RenderPage (PageFileName, variables) {
    const File          = fs.readFileSync(`./pages/${PageFileName}`)?.toString();
    let HTMLFileContent = File;



    const FileTypes = [
        { extension: "css", element: "style" },
        { extension: "js" , element: "script" }
    ]


    for (const FileType of FileTypes) {
        const ImportRegex = new RegExp(`@import "[a-zA-Z0-9 -_]+\.${FileType.extension}"`, "g");
        
        if (ImportRegex.test(File)) {
            let Content = "";
    
            HTMLFileContent = HTMLFileContent.replace(ImportRegex, ImportStatement => {
                const FileName = ImportStatement.match(
                    new RegExp(`"[a-zA-Z0-9 -_]+\.${FileType.extension}"`)
                )?.[0]?.replace(/"/g, "")?.trim();
        


                if (!FileName) return ImportStatement;



                const FileContent = fs.readFileSync(`./pages/${FileName}`)?.toString();
        
                if (!FileContent) return ImportStatement;
        


                Content += FileContent;
                
                return "";
            });
    
            if (Content.length > 1) {
                HTMLFileContent = HTMLFileContent
                    .replace(
                        "</body>", 
                        
                        `<${FileType.element}>`+
                        `${Content}\n`+
                        `</${FileType.element}>\n`+
                        "</body>"
                    )
            }
        }
    }



    HTMLFileContent = HTMLFileContent.replace(/\$[a-zA-Z0-9 _-]+\$/g, VariableName => {
        if (VariableName in variables) {
            return variables[VariableName]
        } else return VariableName
    });



    return HTMLFileContent;
}